import React from "react";

function Members() {
  const names = ["john", "peter", "bob", "john"];
  const members = [
    {
      id: 1,
      name: "John",
      status: true,
    },
    {
      id: 2,
      name: "Paul",
      status: false,
    },
    {
      id: 3,
      name: "Bob",
      status: false,
    },
    {
      id: 4,
      name: "Alice",
      status: true,
    },
  ];
  return (
    <>
      <div>Members</div>
      <ul>
        {/* {members.map((member, index) => (
            <li key={index}>{index} : {member.name}</li>
        ))} */}
        <ul>
          {names.map((person, i) => (
            <li key={i}>{person}</li>
          ))}
        </ul>
      </ul>
    </>
  );
}

export default Members;
